import {Link} from "react-router-dom"
import { useState } from "react"


function Nav ({items}){
    const [link, setLink] = useState("/")

    function getLink(item){
        setLink(`/${item}`.toLowerCase())
        console.log(Link)
        return link;
    }

    return (
        <ul className={styles.navList}>
            {
                items.map((item, key)=>{
                    return <>
                    <Link key={key} className={styles.navItem} to={getLink(item)}>{item}</Link>
                    </>
                    //return <li key={key} className={styles.navItem}>{item}</li>
                    //return <li key={key} className={styles.navItem}>{item}</li>
                })
            }
        </ul>
    )
}

export default Nav;
